import logo from './logo.svg';
import './App.css';
import Header from "./Components/Header";
import Header01 from "./Components/Header01";

function App() {
    return (
        <div className="App">

            {/* El componente de Header se puede poner así:*/}
            <Header/>

            {/*  también así para incluir los props  */}
            {/*  "título" es la propiedad, se le asigna un valor: "Prueba uno" */}
            <Header
                titulo="Prueba uno"
                descripcion="Utiliza el formulario y obten una cotización"/>


            <Header01/>

            <div className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>Edit <code>src/App.js</code> and save to reload.</p>
                <a className="App-link"
                   href="https://www.20minutos.es/"
                   target="_blank"
                   rel="noopener noreferrer">
                    periódico
                </a>
                <p>Hola mundo</p>
            </div>
        </div>
    );
}

export default App;
